import React, {useState} from "react";
import SemCard from "./SemCard"


function App() {

 const [marks, setMarks] = useState(0);
 const [tt, setTT] = useState(0);

 const marksHandler = (marks)=>{
   setMarks(marks += 1);
 }

  return (
    <div className="flex">
      <SemCard sem="3" />
      { tt == 1?
        <SemCard sem="4" />:<p>lol</p>
      }

      <SemCard sem="5" />
      <SemCard sem="7" />



    <div className="flex">
    <p>Select marks</p>
    <div className="bg-blue-100 p-10 rounded-full">{marks}</div>
    <div className="bg-blue-100 p-10 rounded-full" onClick={marksHandler}>Increase</div>
    </div>
    </div>
  );
}

export default App;
